import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import styled from 'styled-components'
import anime from 'animejs'
import Typist from 'react-typist';

const Wrapper = styled.div`

    display: flex;
    position: relative;
    background-color: pink;
    width: 100%;
    height: auto

`

const Hero = styled.div`
`

const AlbumReviewContainer = styled.div`

    display: flex;
    flex-direction: column;
`

const AlbumReview = styled.div`

    background-color: pink;
    display: flex;
    h1, h2, h3, h4, p {
        margin: 0;
    }
    .albumInfo {
        margin: 10px;
    }
    .albumCover {
        height: 200px;
        width: 200px;
        background-color: lightgray;
        margin: 20px;
    }
    h3 {
        font-size: 40px;
    }

`

class Charts extends Component {

    state = {

    }

    componentDidMount() {

    }

    componentDidUpdate() {

    }

    albumReview = [
        {
            name: "test"
        }
    ]

    render() {
        return (
            <Wrapper className="wrapper">
            <Hero></Hero>
            <AlbumReviewContainer>
            {this.albumReview && this.albumReview.map((albumReview, i) => (
                    <AlbumReview>
                        <div className="albumCover">
                        </div>
                        <div className="albumInfo">
                            <h3>{albumReview.name}</h3>
                            <h4>{albumReview.artist}</h4>
                            <p>{albumReview.date}</p>
                        </div>

                    </AlbumReview>
                    ))}
            </AlbumReviewContainer>
            </Wrapper>
        );
    }

}

export default Charts;
